import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from 'react-router-dom';


function App() {
  return (
    <section>

      <NavBar />


      <Routes>

          <Route path="/cadastros" component={<PageCadastros/>} />

      </Routes>

      <PageCadastros />



      <nav>
        <Formulario />
      </nav>



    </section>
  );
}

export default App;
